    true,nt"url": null,nt"notes": "Publication from GRC Transactions, Vol.
    35, 2011nnAbstract:nAs part of the planning for stimulation of the Newberry VolcanonEnhanced
    Geothermal Systems (EGS) Demonstration projectnin Oregon, a high-resolution borehole
    televiewer (BHTV) log wasnacquired using the ALT ABI85 BHTV tool in the slightly
    deviatednNWG 55-29 well. The image log reveals an extensive network ofnfractures
    in a conjugate set striking approximately N-S and dippingn50u00c3u201au00c2u00b0
    that are well oriented for normal slip and are consistent withnsurface-breaking
    regional normal faults in the vicinity. Similarly,nbreakouts indicate a consistent
    minimum horizontal stress, Shmin,nazimuth of 092.3u00c3u201au00c2u00b117.3u00c3u201au00c2u00b0.
    In conjunction with a suite of geophysicalnlogs, a model of the stress magnitudes
    constrained by the widthnof breakouts at depth and a model of rock strength independentlynindicates
    a predominantly normal faulting stress regime.",nt"license_title": "Creative
